import React from 'react';
import BotCard from './BotCard';
const Bot = ({ bot, onEnlist, onDelete }) => {
  const { id, name, health, damage, armor, bot_class, catchphrase, avatar_url, bonus_variables } = bot;

  return (
    <div className="bot-card">
      <img src={avatar_url} alt={name} />
      <h3>{name}</h3>
      <p>Health: {health}</p>
      <p>Damage: {damage}</p>
      <p>Armor: {armor}</p>
      <p>Class: {bot_class}</p>
      <p>Catchphrase: {catchphrase}</p>
      <p>Bonus Variables: {bonus_variables}</p>
      {onEnlist && <button onClick={() => onEnlist(bot)}>Enlist</button>}
      {onDelete && <button onClick={() => onDelete(id)}>Delete</button>}
    </div>
  );
};

export default Bot;
